import React from 'react';
import './SeparationClassifier.css';

const SeparationClassifier = ({ data, onReset }) => {
  // Helper function to display bracket-separated items
  const renderSeparatedItems = (items) => {
    if (!items || items.length === 0) return <p>No separated items found</p>;

    return (
      <div className="separated-items">
        {items.map((item, index) => (
          <div key={index} className="separated-item">
            <div className="item-header">Item {index + 1}</div>
            <div className="item-content">
              {typeof item === 'object' ? 
                Object.entries(item).map(([key, value]) => (
                  <div key={key} className="item-property">
                    <span className="property-name">{key}:</span>
                    <span className="property-value">{String(value)}</span>
                  </div>
                ))
                : 
                <div className="item-value">{String(item)}</div>
              }
            </div>
          </div>
        ))}
      </div>
    );
  };

  return (
    <div className="separation-classifier-container">
      <h3>Bracket Separated Values</h3>

      {data ? (
        <div className="data-display">
          {renderSeparatedItems(data)}
        </div>
      ) : (
        <p>No data available</p>
      )}

      <button 
        className="reset-button" 
        onClick={onReset}
      >
        Reset
      </button>
    </div>
  );
};

export default SeparationClassifier;
